import axios from 'axios';
import { MISOResponse } from '../types/energy.ts';

const API_URL = 'http://localhost:8000/api';

export const getMISOData = async (): Promise<MISOResponse> => {
  try {
    const response = await axios.get<MISOResponse>(`${API_URL}/miso-rt-data/`);
    return response.data;
  } catch (error) {
    console.error('Error fetching MISO data:', error);
    throw error;
  }
};
